CREATE TABLE personae (
       id SERIAL PRIMARY KEY,
       firstname TEXT NOT NULL,
       lastname TEXT,
       birthdate DATE,
       account_balance MONEY
);


-- events persona IDs start at 1149
UPDATE personae SET id = id + 1148;

CREATE TABLE elements (
       id SERIAL PRIMARY KEY,
       content TEXT,
       points_max INTEGER CHECK (points_max >= 0),
       module INTEGER, -- references a modules table, if we had one
       hint TEXT,
       max_tries INTEGER CHECK (max_tries > 0)
);



CREATE TABLE public.events (
    id SERIAL PRIMARY KEY,
    moment TIMESTAMP WITHOUT TIME ZONE DEFAULT now(),
    persona INTEGER REFERENCES personae (id),
    element INTEGER NOT NULL,
    score INTEGER DEFAULT 0 NOT NULL,
    hints INTEGER DEFAULT 0 NOT NULL,
    latency REAL,
    answer TEXT,
    feedback TEXT,
    CONSTRAINT events_hints_check CHECK (hints >= 0),
    CONSTRAINT events_score_check CHECK ((score >= 0) AND (score <= 1000))
);



-- Because we set event IDs manually, the events_id_seq sequence is still at 1.
-- It must be advanced to 1000 so future queries can insert events 1001, 1002,
-- etc.
SELECT setval('events_id_seq', 1000);
